// This file contains Http requests
export default {
    getData: () => {
        return fetch('/crud')
            .then(res => res.json())
            .then(data => data);
    },
    deleteData: (_id) => {
        return fetch(`/crud/${_id}`,
            { method: 'delete' })
            .then(res => res.json())
            .then(data => data);
    },
    updateData: (data) => {
        return fetch(`/crud/${data._id}`,
            {
                method: "put",
                body: JSON.stringify(data),
                headers: {
                    "Content-Type": "application/json"
                }
            }).then(res => res.json())
            .then(data => data);
    },
    createData: (data) => {
        return fetch(`/crud`,
            {
                method: 'post',
                body: JSON.stringify(data),
                headers: {
                    "Content-Type": "application/json"
                }
            }).then(res => res.json())
            .then(data => data);
    }
}
